          // create a multer upload\n            const user: JwtPayloadInterface = req.user;\n            return multer({\n                storage: multerS3({\n                    s3: this.s3,\n                    bucket: `rent-a-car-photos/${user.email}/${category}`,\n                    acl: 'public-read',\n                    key: function (request, file, cb) {\n                        cb(null, `${Date.now()}-${file.originalname}`); // unique id generator for file (image tag)\n                    },\n                }),\n            }).array('upload', 9);\n        } catch (err) {\n            throw new Error(err)\n        }\n    }\n\n}\n    \n\n\n\n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/CreateRentalDto.html":{"url":"injectables/CreateRentalDto.html","title":"injectable - CreateRentalDto","body":"\n                   \n\n\n\n\n\n\n\n\n  Injectables\n  CreateRentalDto\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/rental/dto/crud/create-rental-dto.ts\n        \n\n            \n                Description\n            \n            \n                Create Rental DTO\n\n            \n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                features\n                            \n                            \n                                listed\n                            \n                            \n                                location\n                            \n                            \n                                photos\n                            \n            